import React from 'react';

const LayerLibrary: React.FC = () => {
    const layerTypes = [
        { type: 'InputLayer', name: 'Input Layer' },
        { type: 'Conv2DLayer', name: 'Conv2D Layer' },
        { type: 'OutputLayer', name: 'Output Layer' },
        { type: 'ConcatLayer', name: 'Concat Layer' },
    ];

    const handleDragStart = (e: React.DragEvent, layerType: string) => {
        e.dataTransfer.setData('text/plain', JSON.stringify({
            type: layerType,
            id: Date.now(),
        }));
    };

    return (
        <div style={{ 
            width: 200, 
            border: '1px solid #444', 
            padding: 16, 
            background: '#2d2d2d',
            color: '#ffffff'
        }}>
            <h3 style={{ color: '#ffffff', marginTop: 0 }}>Layer Library</h3>
            {layerTypes.map((layer) => (
                <div
                    key={layer.type}
                    draggable
                    onDragStart={(e) => handleDragStart(e, layer.type)}
                    style={{
                        padding: 8,
                        margin: '8px 0',
                        background: '#3a3a3a',
                        border: '1px solid #555',
                        borderRadius: 4,
                        cursor: 'grab',
                        color: '#ffffff',
                        transition: 'background-color 0.2s'
                    }}
                    onMouseEnter={(e) => e.currentTarget.style.backgroundColor = '#4a4a4a'}
                    onMouseLeave={(e) => e.currentTarget.style.backgroundColor = '#3a3a3a'}
                >
                    {layer.name}
                </div>
            ))}
        </div>
    );
};

export default LayerLibrary;
